import React from "react";
import Perfil from "../Img/fotoFondo.jpg";
import "./Content.css";

const Content = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-sm-4  h-img-full">
          <img src={Perfil} alt="perfil" className="img-fluid h-img" />
        </div>
        <div className="col-8 mx-5 p-5 text-start">
          <span className="hello">Hello, I am</span>
          <h2 className="me1">Ricardo</h2>
          <h2 className="me">Ramirez</h2>
          <span className="col-auto">
            A passionate young front-end designer crazy about mobile and web
            design
          </span>
        </div>
      </div>
    </div>
  );
};

export default Content;
